Output: {{'answer': '١٣'}}
---
Input: {{'problem': 'An astronaut on the International Space Station needs to conduct a series of experiments. Each experiment requires 2.5 hours, and she must complete 8 experiments. However, she needs to take a 15-minute break between each experiment. How many total hours will all the experiments take, including breaks?'}}
Output: {{'answer': '٢١ ساعة و ٤٥ دقيقة'}}
---
