Output: {{'answer': 'двенадцать'}}
---
Input: {{'problem': 'A community orchestra has 84 musicians. During a renovation of the concert hall, only 3/4 of the musicians can fit on the temporary stage. If each row on the temporary stage can seat 12 musicians, how many complete rows will be needed to seat all the performing musicians?'}}
Output: {{'answer': 'six'}}
---
Input: {{'problem': 'During a basketball tournament, Team Phoenix had a shooting accuracy of 45% in the first half, making 18 successful shots. In the second half, they improved their accuracy to 60%. If they attempted the same number of shots in both halves and ended up with a total of 42 successful shots for the entire game, how many shots did they attempt in total during the game? Round to the nearest whole number.'}}
Output: {{'answer': '팔십'}}
---
Input: {{'problem': "During an NBA basketball tournament, a team's shooting statistics show they make 45% of their three-point shots and 60% of their two-point shots. In their last game, they scored 78 points total, and the number of successful three-point shots was exactly half the number of successful two-point shots. How many three-point shots did they successfully make in that game?"}}
Output: {{'answer': '육'}}
---
