Output: {{'answer': 'четыреста семнадцать'}}
---
Input: {{'problem': "A space station's solar panels generate 480 kilowatts of power when directly facing the Sun. As the station orbits Earth, it spends 40% of its time in Earth's shadow where the panels generate no power. Additionally, due to the constantly changing angle of the panels relative to the Sun during the lit portion of orbit, the panels operate at only 75% efficiency when not in shadow. If the station needs a minimum constant power supply, how many kilowatts must its battery system be able to store to maintain operations during the shadow period? Round to the nearest whole number."}}
Output: {{'answer': '١٤٤'}}
---
